import React from "react";
import "./Goals.css";
import GoalItem from "../GoalItem/GoalItem";

const Goals = (props) => {
    console.log(props);

    return (
        <section id="goals">
        <ul className="goal-list">
            {props.items.map(goal => (
                          <GoalItem 
                          goal={props.goals}
                          />
            ))}
        </ul>
      </section>
    )
}

export default Goals;
